import React from 'react'
import { Dropdown } from 'semantic-ui-react'

export default function Cities() {
    return (
        <div>
            <Dropdown
                placeholder='I close on blur'
                closeOnBlur
                selection
                fixed='right'
                options={[]}
            />
            <Dropdown
                placeholder='I stay open on blur'
                closeOnBlur={false}
                selection
                options={[]}
            />
        </div>
    )
}
